import React, { useState } from 'react';
import '../App.css';
import { Link } from 'react-router-dom';
import SearchBox from './SearchBox';

const Profile = () => {
    const [showForm, setShowForm] = useState(false);
    const [isLogin, setIsLogin] = useState(true);

    const toggleForm = () => {
        setShowForm(!showForm);
    };

    const switchForm = () => {
        setIsLogin(!isLogin);
    };

    return (
        <>
            <header className="header">
                <div className="wrapper">
                    <div className="navbar">
                        <img src="./images/logo.png" className="nav_logo" alt="logo" />
                        <p>Book App</p>
                        <div className="navMenu">
                            <ul>
                                <li><Link to="/MainPage"><h3>Strona główna</h3></Link></li>
                                <li><Link to="/TBR"><h3>Chcę przeczytać</h3></Link></li>
                                <li><Link to="/MojaPolka"><h3>Moja półka</h3></Link></li>
                                <li><Link to="/katalog"><h3>Katalog</h3></Link></li>
                                <li><Link to="/Najlepsze"><h3>Najlepiej oceniane</h3></Link></li>
                                <li><Link to="/Favorites"><h3>Ulubione</h3></Link></li>
                                <li><Link to="/SearchBox"><h3>Szukaj</h3></Link></li>
                            </ul>
                            <div class="nav_button">
                                <button class="my_profile_btn" id="form-open">Mój Profil</button>
                                <button class="logout_btn" id="logout_btn">Wyloguj</button>
                            </div>
                        </div>
                    </div>
                </div>
                <script type="module" src="logout.js" defer></script>
            </header>
        </>
    );
};

export default Profile;
